  [],\n\t\"revision_timestamp\": \"2016-07-27T23:04:20.423084\",\n\t\"name\": \"gulf-of-maine-tern-management-plan-1984\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The following management plan provides
  an outline of the tasks proposed to restore tern numbers to levels approximating
  those reached during the last period of population growth. This recovery will not
  happen by itself. During a short period of hands-off protection in the late 1970s,
  gulls overran the terns nesting at Petit Manan. The terns promptly responded to
  this intervention by returning to the island. We also know that the mere presence
  of terns nesting on an island is not enough; our measurements show that the terns
  nesting on almost all islands that are not being managed suffer almost total breeding
  failure. These objectives include Machias Seal Island in the Grand Manan Archipelago,
  through the cooperation of the Canadian Wildlife Service.\",\n\t\"license_title\":
